            $('#health_only').slideUp(300);
            $('#insurance_type').val('medicare');
            $('#form_title').text(function () {
                return $(this).text().replace("health", "medicare");
            });
            $('#form_info').text(function () {
                return $(this).text().replace("health", "medicare");
            });
            $("#household-size").prop('required', false);
